/*Table structure for table `shop_category_seller` */

DROP TABLE IF EXISTS `shop_category_seller`;

CREATE TABLE `shop_category_seller` (
  `cid` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '类目id',
  `parent_cid` bigint(20) DEFAULT NULL COMMENT '类目父id',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `cname` varchar(200) DEFAULT NULL COMMENT '类目名称',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态，1、有效，2、删除',
  `lev` tinyint(4) DEFAULT NULL COMMENT '类目级别,1:一级类目;2:二级类目;3:三级类目,目前只支持二级类目',
  `has_leaf` tinyint(4) DEFAULT NULL COMMENT '是否叶子节点 1叶子节点   0非叶子节点',
  `sort_number` int(4) DEFAULT NULL COMMENT '排序号,排序号越小越靠前',
  `home_show` tinyint(4) DEFAULT NULL COMMENT '是否前台首页展示,1:是;2:否',
  `expand` tinyint(4) DEFAULT NULL COMMENT '标记分类是否在首页展开，1、是，2、否',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `modified` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`cid`)
) ENGINE=InnoDB AUTO_INCREMENT=317 DEFAULT CHARSET=utf8;

