  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `station_id` varchar(30) DEFAULT NULL COMMENT '站点ID',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `number` varchar(20) DEFAULT NULL COMMENT '客服号码',
  `operator` varchar(20) DEFAULT NULL COMMENT '添加号码的人',
  `created_dt` datetime DEFAULT NULL COMMENT '创建时间',
  `last_upd_dt` datetime DEFAULT NULL COMMENT '更新时间',
  `deleted_flag` tinyint(4) DEFAULT NULL COMMENT ' 是否有效，1为有效，0为无效',
  `add1` varchar(20) DEFAULT NULL COMMENT '备用字段1',
  `add2` varchar(20) DEFAULT NULL COMMENT '备用字段2',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=123 DEFAULT CHARSET=utf8;

