/*Table structure for table `shop_delivery_type` */

DROP TABLE IF EXISTS `shop_delivery_type`;

CREATE TABLE `shop_delivery_type` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '运送方式id，主键',
  `template_id` bigint(20) DEFAULT NULL COMMENT '模板id',
  `first_part` decimal(14,2) DEFAULT NULL COMMENT '首件/首重量/首体积',
  `first_price` decimal(14,2) DEFAULT NULL COMMENT '首费',
  `continues` decimal(14,2) DEFAULT NULL COMMENT '续件/续重量/续体积',
  `continue_price` decimal(14,2) DEFAULT NULL COMMENT '续费',
  `delivery_to` varchar(255) DEFAULT NULL COMMENT '运送至',
  `delivery_type` tinyint(3) DEFAULT NULL COMMENT '运送方式，1快递，2EMS，3平邮',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `create_time` datetime DEFAULT NULL COMMENT '运送方式创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '运送方式修改时间',
  `del_state` varchar(5) DEFAULT NULL COMMENT '是否删除（假删）1，未删，2已删',
  `delivery_address` varchar(255) DEFAULT NULL COMMENT '运送地址文字',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1570 DEFAULT CHARSET=utf8;

