/*Table structure for table `shop_domain_mapper` */

DROP TABLE IF EXISTS `shop_domain_mapper`;

CREATE TABLE `shop_domain_mapper` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `domain` varchar(255) DEFAULT NULL COMMENT '自定义域名',
  `state` int(11) DEFAULT NULL COMMENT '自定义域名状态(1、待审核；2、驳回；3、审核通过)',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `reviewer` varchar(50) DEFAULT NULL COMMENT '审核人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='�����Զ�������';

