/*Table structure for table `shop_evaluation` */

DROP TABLE IF EXISTS `shop_evaluation`;

CREATE TABLE `shop_evaluation` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` bigint(20) DEFAULT NULL COMMENT '评价人id',
  `user_shop_id` bigint(20) DEFAULT NULL COMMENT '评价人店铺id',
  `resource` varchar(10) DEFAULT NULL COMMENT '1:默认评价 2:手动评价',
  `by_shop_id` bigint(20) DEFAULT NULL COMMENT '被评价店铺ID',
  `order_id` bigint(20) DEFAULT NULL COMMENT '订单id',
  `shop_description_scope` int(11) DEFAULT NULL COMMENT '描述相符评分',
  `shop_service_scope` int(11) DEFAULT NULL COMMENT '服务态度评分',
  `shop_arrival_scope` int(11) DEFAULT NULL COMMENT '到货速度评分',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL COMMENT '编辑时间',
  PRIMARY KEY (`id`),
  KEY `shop_evaluation_shop_id_index` (`by_shop_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=497 DEFAULT CHARSET=utf8 COMMENT='��������';

