/*Table structure for table `shop_fare` */

DROP TABLE IF EXISTS `shop_fare`;

CREATE TABLE `shop_fare` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `fare_name` varchar(50) DEFAULT NULL COMMENT '运费名称',
  `fare_type` varchar(20) DEFAULT NULL COMMENT '运送方式,多个以逗号相隔（1代表快递，2代表货运）',
  `payment_type` tinyint(3) unsigned DEFAULT NULL COMMENT '1:运费到付、2:包邮',
  `fare_region` varchar(150) DEFAULT NULL COMMENT '运送范围,多个以逗号相隔（0代表全国）',
  `first_weight_price` decimal(10,2) DEFAULT NULL COMMENT '首重价格',
  `continue_weight_price` decimal(10,2) DEFAULT NULL COMMENT '续重价格',
  PRIMARY KEY (`id`),
  KEY `id` (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='�����˷�';

