/*Table structure for table `shop_freight_template` */

DROP TABLE IF EXISTS `shop_freight_template`;

CREATE TABLE `shop_freight_template` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '运费模板id，主键',
  `template_name` varchar(100) DEFAULT NULL COMMENT '模板名称',
  `province_id` bigint(20) DEFAULT NULL COMMENT '省',
  `city_id` bigint(20) DEFAULT NULL COMMENT '市',
  `county_id` bigint(20) DEFAULT NULL COMMENT '县',
  `address_details` varchar(100) DEFAULT NULL COMMENT '详细地址',
  `delivery_time` varchar(100) DEFAULT NULL COMMENT '发货时间',
  `postage_free` tinyint(3) DEFAULT NULL COMMENT '是否包邮，1自定义运费，2卖家承担运费',
  `delivery_type` varchar(20) DEFAULT NULL COMMENT '运送方式，1快递，2EMS，3平邮.多个运送方式使用逗号隔开',
  `valuation_way` tinyint(3) DEFAULT NULL COMMENT '计价方式，1件数，2重量，3体积',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `create_time` datetime DEFAULT NULL COMMENT '模板创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '模板修改时间',
  `del_state` varchar(5) DEFAULT NULL COMMENT '是否删除（假删）1，未删，2已删',
  PRIMARY KEY (`id`)
