/*Table structure for table `shop_info` */

DROP TABLE IF EXISTS `shop_info`;

CREATE TABLE `shop_info` (
  `shop_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '店铺id',
  `shop_name` varchar(200) DEFAULT NULL COMMENT '店铺名称',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `platform_id` bigint(20) DEFAULT NULL COMMENT '审核信息id',
  `status` tinyint(4) DEFAULT NULL COMMENT '店铺建新状态;1是申请，2是通过，3是驳回， 4是平台关闭，5是开通',
  `shop_url` varchar(512) DEFAULT NULL COMMENT '店铺域名',
  `logo_url` varchar(512) DEFAULT NULL COMMENT '店铺logo url',
  `keyword` varchar(512) DEFAULT NULL COMMENT '关键字',
  `introduce` varchar(512) DEFAULT NULL COMMENT '店铺介绍',
  `main_sell` varchar(512) DEFAULT NULL COMMENT '店铺主营',
  `price_min` decimal(14,2) DEFAULT NULL COMMENT '混批金额要求',
  `mount_min` bigint(20) DEFAULT NULL COMMENT '批混数量要求',
  `province_code` varchar(10) DEFAULT NULL COMMENT '省份代码',
  `province_name` varchar(512) DEFAULT NULL COMMENT '省份名字',
  `zcode` varchar(10) DEFAULT NULL COMMENT '邮政编码',
  `street_name` varchar(512) DEFAULT NULL COMMENT '街道名字',
  `mobile` bigint(11) DEFAULT NULL COMMENT '手机号码',
  `area_code` varchar(10) DEFAULT NULL COMMENT '座机区号',
  `landline` varchar(10) DEFAULT NULL COMMENT '座机号码',
  `extension_number` varchar(10) DEFAULT NULL COMMENT '分机号码',
  `created` datetime DEFAULT NULL COMMENT '申请时间',
  `modified` datetime DEFAULT NULL COMMENT '更新时间',
  `pass_time` datetime DEFAULT NULL COMMENT '开通时间',
  `end_time` datetime DEFAULT NULL COMMENT '终止时间',
  `seller_brand` varchar(500) DEFAULT NULL COMMENT '运营商品品牌',
  `comment` varchar(500) DEFAULT NULL COMMENT '批注',
  `platform_user_id` varchar(100) DEFAULT NULL COMMENT '审核人ID',
  `mutilPrice` tinyint(4) DEFAULT NULL COMMENT '是否混批（1为混批，2为不混批）',
  `city_name` varchar(100) DEFAULT NULL COMMENT '市的名字',
  `city_code` varchar(10) DEFAULT NULL COMMENT '市的代码',
  `district_name` varchar(100) DEFAULT NULL COMMENT '区的名字',
  `district_code` varchar(10) DEFAULT NULL COMMENT '区的代码',
