/*Table structure for table `shop_modify_detail` */

DROP TABLE IF EXISTS `shop_modify_detail`;

CREATE TABLE `shop_modify_detail` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `modify_info_id` bigint(20) DEFAULT NULL COMMENT '关联modify_info表的id',
  `properties_column` varchar(255) DEFAULT NULL COMMENT '申请修改的属性列名',
  `before_change` varchar(255) DEFAULT NULL COMMENT '修改前的内容',
  `after_change` varchar(255) DEFAULT NULL COMMENT '修改后的内容',
  `create_time` date DEFAULT NULL COMMENT '申请创建时间',
  `review_reason` varchar(255) DEFAULT NULL COMMENT '审核理由',
  `review_user_id` varchar(100) DEFAULT NULL COMMENT '审核人ID',
  `review_time` date DEFAULT NULL COMMENT '审核时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='�����޸���ϸ';

