/*Table structure for table `shop_preferential_way` */

DROP TABLE IF EXISTS `shop_preferential_way`;

CREATE TABLE `shop_preferential_way` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '优惠方式id，主键',
  `template_id` bigint(20) DEFAULT NULL COMMENT '运费模板id',
  `delivery_type` tinyint(3) DEFAULT NULL COMMENT '优惠方式，，1件数，2重量，3体积 4金额',
  `strategy` tinyint(3) DEFAULT NULL COMMENT '策略，1满减，2包邮',
  `full` decimal(14,2) DEFAULT NULL COMMENT '满多少件/重量/体积',
  `reduce` decimal(14,2) DEFAULT NULL COMMENT '减多少钱（元）',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '卖家id',
  `create_time` datetime DEFAULT NULL COMMENT '优惠方式创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '优惠方式修改时间',
  `del_state` varchar(5) DEFAULT NULL COMMENT '是否删除（假删）1，未删，2已删',
  `delivery_to` varchar(255) DEFAULT NULL COMMENT '运送至（用于优惠方式），0代表所有地区',
  `delivery_address` varchar(255) DEFAULT NULL COMMENT '运送至（用于优惠方式）文字表述，0代表所有地区',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1056 DEFAULT CHARSET=utf8;

