/*Table structure for table `shop_renovation` */

DROP TABLE IF EXISTS `shop_renovation`;

CREATE TABLE `shop_renovation` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `module_name` varchar(100) DEFAULT NULL COMMENT '模块名称',
  `price` varchar(50) DEFAULT NULL COMMENT '价格',
  `picture_url` varchar(200) DEFAULT NULL COMMENT '图片地址',
  `module_group` tinyint(4) DEFAULT NULL COMMENT '1:基础模块,2:系统模块',
  `modult_type` tinyint(4) DEFAULT NULL COMMENT '1：header，2：模板1广告位，4：推荐位，9：模板1广告位Outer，13：模板2轮播图，12：模板2轮播图Outer，11：模板2广告位，10：模板,12广告位Outer',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态，1:有效 ,2:删除 3使用中',
  `created` datetime DEFAULT NULL COMMENT '创建日期',
  `modified` datetime DEFAULT NULL COMMENT '修改日期',
  `sku_id` bigint(20) DEFAULT NULL COMMENT '商品skuid',
  `position` varchar(10) DEFAULT NULL COMMENT '位置  （从a开始顺延  页面从上至下）',
  `templates_id` bigint(20) DEFAULT NULL COMMENT '模板id (1模板一  ，2 模板二 ）',
  `chain_url` varchar(512) DEFAULT NULL COMMENT '跳转地址',
  `hasPrice` int(10) DEFAULT NULL COMMENT '是否有报价：1有价格，2无价格',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1412 DEFAULT CHARSET=utf8 COMMENT='����װ�� ��ʵ�ֱ�';

