/* Function  structure for function  `get_shop_no` */

/*!50003 DROP FUNCTION IF EXISTS `get_shop_no` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `get_shop_no`() RETURNS varchar(13) CHARSET utf8
BEGIN
	DECLARE order_no VARCHAR(13);
	DECLARE seq_val BIGINT(10);
	SELECT seq_nextval('shop_id') INTO seq_val;
	SELECT CONCAT(2,LPAD(CONVERT(seq_val,CHAR),9,'0')) INTO order_no;
	RETURN order_no;
    END */$$
DELIMITER ;

/* Function  structure for function  `seq_currval` */

/*!50003 DROP FUNCTION IF EXISTS `seq_currval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `seq_currval`(sequence_name VARCHAR(50)) RETURNS bigint(10)
BEGIN
	DECLARE cvalue INTEGER;  
	SELECT current_value INTO cvalue  
	FROM sequence  
	WHERE seq_name = sequence_name;  
	RETURN cvalue;
    END */$$
DELIMITER ;

/* Function  structure for function  `seq_nextval` */

/*!50003 DROP FUNCTION IF EXISTS `seq_nextval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `seq_nextval`(sequence_name VARCHAR(50)) RETURNS bigint(10)
BEGIN
	UPDATE sequence  
	SET sequence.current_value = sequence.current_value + sequence.increment  
	WHERE sequence.seq_name = sequence_name;
	RETURN seq_currval(sequence_name);
    END */$$
DELIMITER ;

